  const { id } = useParams();
  useEffect(() => {
    fetch(`/Boutique/"${id}`)
      .then((res) => res.json())
      .then((data) => setData(data));
  });
  console.log(data);
  return (
    <div>
      <h1>Hola</h1>
    </div>
  );
};

export default DetalleProducto;
